import React from 'react';
import { Link } from 'react-router-dom';

const userHomeContainerStyle = {
  display: 'flex',
  justifyContent: 'center',
  alignItems: 'center',
  height: '100vh',
  backgroundColor: '#007bff',
  color: '#f0f0f0',
};

const homeContentStyle = {
  textAlign: 'center',
  maxWidth: '600px',
  padding: '20px',
  borderRadius: '10px',
  boxShadow: '0 0 10px rgba(0, 0, 0, 0.1)',
  backgroundColor: '#fff',
};

const headingStyle = {
  fontSize: '28px',
  marginBottom: '15px',
};

const paragraphStyle = {
  fontSize: '16px',
  marginBottom: '10px',
};

const buttonStyle = {
  backgroundColor: '#f0f0f0',
  color: '#007bff',
  padding: '12px 20px',
  border: 'none',
  borderRadius: '5px',
  cursor: 'pointer',
  fontSize: '16px',
  textDecoration: 'none',
};

const Userhome = () => {
  return (
    <div style={userHomeContainerStyle}>
      <div style={homeContentStyle}>
        <h1 style={headingStyle}>Welcome to XYZ Hospital</h1>
        <p style={paragraphStyle}>
          Lorem ipsum dolor sit amet, consectetur adipiscing elit. Ut rhoncus
          risus eget dapibus facilisis.
        </p>
        <p style={paragraphStyle}>
          In this hospital, we strive to provide the best healthcare services
          to our patients.
        </p>
        <Link to="/Userbook" style={{ textDecoration: 'none' }}>
          <button style={buttonStyle}>Go to User Book</button>
        </Link>
      </div>
    </div>
  );
};

export default Userhome;
